import React from "react";

import Header from "../components/Header";
import Card from "../components/Card";

const Homepage = ({ articles }) => {
    const test = articles
  return (
    <div>
        <Header/>  
        <p>Welcome to the Homepage</p>
        <div > {/* class="container" */}
            <div class="row">
                
                    <Card
                        article={test[0]}
                    />
               
            </div>
        </div>
    </div>
    
  );
};

export default Homepage;
